import React, { Component } from 'react'
import TeamMembers from './TeamMember'

class Team extends Component {
    render() {
    
        return (
            <div className="row">
                <TeamMembers />
                <TeamMembers />
                <TeamMembers/>  
            </div>
        )
    }
}

export default Team
